package com.java;

public class Operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
// relational //
		int a = 7, b = 11;
	    System.out.println("a is " + a + " and b is " + b);
	    // == operator
	    System.out.println(a == b);  // false
	    // != operator
	    System.out.println(a != b);  // true
	}

}
